import React from 'react';
import { motion } from 'framer-motion';

const About: React.FC = () => {
  const skills = [
    { name: 'Entrenamiento de Fuerza', level: 75, icon: 'üèãÔ∏è' },
    { name: 'Cardio', level: 60, icon: 'üèÉ' },
    { name: 'Nutrici√≥n', level: 80, icon: 'ü•ó' },
    { name: 'Constancia', level: 90, icon: 'üí™' },
    { name: 'Motivaci√≥n', level: 95, icon: 'üî•' }
  ];

  const timeline = [
    {
      date: 'Enero 2025',
      title: 'Inicio del viaje',
      description: 'Decid√≠ cambiar mi estilo de vida y comenzar a entrenar regularmente.',
      icon: 'üöÄ'
    },
    {
      date: 'Febrero 2025',
      title: 'Primeros resultados',
      description: 'Comenc√© a ver cambios f√≠sicos y mentales significativos.',
      icon: 'üìà'
    },
    {
      date: 'Presente',
      title: 'Compartiendo mi experiencia',
      description: 'Cre√© este blog para documentar y compartir mi progreso.',
      icon: '‚úçÔ∏è'
    }
  ];

  return (
    <div className="min-h-screen bg-gray-50 pt-20">
      {/* Hero Section */}
      <section className="py-16 bg-gradient-to-br from-blue-600 via-purple-600 to-blue-800 text-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
            {/* Text Content */}
            <motion.div
              initial={{ opacity: 0, x: -30 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8 }}
            >
              <h1 className="text-4xl md:text-5xl font-bold mb-6">
                Hola, soy Gonza üëã
              </h1>
              <p className="text-xl text-blue-100 mb-6 leading-relaxed">
                Un desarrollador apasionado que decidi√≥ embarcarse en un viaje de 
                transformaci√≥n personal a trav√©s del fitness y el entrenamiento.
              </p>
              <p className="text-lg text-blue-200 leading-relaxed">
                Este blog es mi diario personal donde comparto mis experiencias, 
                aprendizajes y reflexiones en este camino hacia una vida m√°s saludable.
              </p>
            </motion.div>

            {/* Profile Image */}
            <motion.div
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="flex justify-center"
            >
              <div className="relative">
                <motion.div
                  whileHover={{ scale: 1.05 }}
                  transition={{ duration: 0.3 }}
                  className="w-80 h-80 bg-gradient-to-br from-blue-400 to-purple-500 rounded-full flex items-center justify-center text-8xl shadow-2xl"
                >
                  üßë‚Äçüíª
                </motion.div>
                <motion.div
                  initial={{ opacity: 0, scale: 0 }}
                  animate={{ opacity: 1, scale: 1 }}
                  transition={{ duration: 0.6, delay: 0.8 }}
                  className="absolute -bottom-4 -right-4 bg-yellow-400 text-yellow-800 p-3 rounded-full text-2xl shadow-lg"
                >
                  üí™
                </motion.div>
              </div>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Skills Section */}
      <section className="py-16">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="text-center mb-12"
          >
            <h2 className="text-3xl md:text-4xl font-bold text-gray-800 mb-4">
              Mi Progreso Actual
            </h2>
            <p className="text-gray-600 max-w-2xl mx-auto">
              Estas son las √°reas en las que he estado trabajando y mi nivel actual de progreso.
            </p>
          </motion.div>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {skills.map((skill, index) => (
              <motion.div
                key={skill.name}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                viewport={{ once: true }}
                className="bg-white rounded-xl p-6 shadow-lg hover:shadow-xl transition-shadow duration-300"
              >
                <div className="flex items-center mb-4">
                  <span className="text-3xl mr-3">{skill.icon}</span>
                  <h3 className="text-lg font-semibold text-gray-800">{skill.name}</h3>
                </div>

                <div className="mb-2">
                  <div className="flex justify-between text-sm text-gray-600 mb-1">
                    <span>Progreso</span>
                    <span>{skill.level}%</span>
                  </div>
                  <div className="w-full bg-gray-200 rounded-full h-3">
                    <motion.div
                      initial={{ width: 0 }}
                      whileInView={{ width: `${skill.level}%` }}
                      transition={{ duration: 1, delay: index * 0.1 + 0.5 }}
                      viewport={{ once: true }}
                      className="bg-gradient-to-r from-blue-500 to-purple-500 h-3 rounded-full"
                    />
                  </div>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Timeline Section */}
      <section className="py-16 bg-white">
        <div className="max-w-4xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="text-center mb-12"
          >
            <h2 className="text-3xl md:text-4xl font-bold text-gray-800 mb-4">
              Mi Viaje Hasta Ahora
            </h2>
            <p className="text-gray-600">
              Los momentos m√°s importantes de mi transformaci√≥n personal.
            </p>
          </motion.div>

          <div className="relative">
            {/* Timeline Line */}
            <div className="absolute left-1/2 transform -translate-x-1/2 w-1 h-full bg-gradient-to-b from-blue-500 to-purple-500 rounded-full"></div>

            {timeline.map((item, index) => (
              <motion.div
                key={index}
